/*** 省市区 初始化
SELECT * FROM DbProvince
SELECT * FROM DbCity
SELECT * FROM DbDistrict
SELECT * FROM DbStreet
***/  
--省份
IF EXISTS(SELECT * FROM SYSOBJECTS WHERE name='DbProvince')
	DROP TABLE DbProvince
CREATE TABLE DbProvince
(
	Kid INT IDENTITY(1,1) PRIMARY KEY,
	Code VARCHAR(50) NOT NULL DEFAULT(''),									--编号
	Name NVARCHAR(50) NOT NULL DEFAULT(''),									--名称
	ShortName NVARCHAR(50) NOT NULL DEFAULT(''),							--短名称
	SubName NVARCHAR(10) NOT NULL DEFAULT(''),								--简称
	PinYin VARCHAR(100) NOT NULL DEFAULT(''),								--简拼
	BuildDate datetime not null default(getdate()),							--创建日期
	ModifyDate datetime not null default(getdate()),						--修改日期
	DbStatus int not null default(0)										--状态 
)
GO 
--城市
